import React, { Component } from 'react';
import NotePreview from './NotePreview.js';

class NoteList extends Component {
  constructor(props){
    super(props);

    this.handleClick = this.handleClick.bind(this);
  }

  handleClick(noteID){
    alert("handling click from NoteList with ID: "+noteID);
    this.props.handleNoteClick(noteID);
  }

  render(){
    let notes = [];
    let i = 0;
    for (i = 0; i < localStorage.length; i++){
      if(localStorage[i] === ""){
        notes.push(<li key={i.toString()} id={i.toString()}><div className="row">New Note</div></li>)
      } else {
        notes.push(<li key={i.toString()} id={i.toString()}><button className=" row" onClick={()=>{this.handleClick(i)}}>
          {localStorage[i]}
        </button></li>)
      }
    }

    // notes = localStorage.map((note) =>
    //   console.log(note)
    // )
    // notes = notes.map((note)=>
    //   <button className="row" onClick={()=>{this.handleClick(i)}}>
    //     <li>note</li>
    //   </button>
    // )

    return <ul>{notes}</ul>
  }
}

export default NoteList;
